      out.write("	 	// dropdown-item 요소의 href와 동일한 경우에 active 클래스 추가\r\n");
      out.write("	    const dropdownItems = document.querySelectorAll('.dropdown-item');\r\n");
      out.write("\r\n");
      out.write("	    dropdownItems.forEach(function(item) {\r\n");
      out.write("	        const href = item.getAttribute('href');\r\n");
      out.write("	\r\n");
      out.write("	        if (currentPath === href) {\r\n");
      out.write("	            item.classList.add('active');\r\n");
      out.write("	            const parentDropdown = item.closest('.dropdown');\r\n");
      out.write("	            const dropdownToggle = parentDropdown.querySelector('.dropdown-toggle');\r\n");
      out.write("	            if (dropdownToggle) {\r\n");
      out.write("	                dropdownToggle.classList.add('active');\r\n");
      out.write("	            }\r\n");
